import {INCREMENT_COUNTER,DECREMENT_COUNTER,SAVE_PLAYERS,GET_PLAYERS } from './types'


//Action Creator
export const incrementCounter = () => ({
    type: INCREMENT_COUNTER
});

export const decrementCounter = () => ({
    type: DECREMENT_COUNTER
});

export const addPlayers = () => async dispatch => ({
    type: SAVE_PLAYERS
});

export const getPlayers = () => async dispatch => ({
    type: GET_PLAYERS
});
